import React, { useEffect } from "react";


const MyShipments = () => {
  const { error, data, loading } = useQuery(GET_SHIPMENTS, {
    variables: {
      id: 1,
    },
  });

  useEffect(() => {
    console.log(loading);
  }, [loading]);

  if (loading) {
    return <p>Loading...</p>;
  }
  return (
    <div>
      {data.user.shipments &&
        data.user.shipments.map((shipment, key) => (
          <p key={key}>{shipment.id}</p>
        ))}
    </div>
  );
};

export default MyShipments;
